import React from 'react'
import WaveMe from './wave-animation'

class Contact extends React.Component {
  render () {
    return (
      <div id='about' className='section section-hero section-contact'>
        <div className='section-contact--copy' data-aos='fade-down'>
          <h1>Contact</h1>
        </div>
        <div className='section-contact--image' data-aos='fade-up'>
          <p>
            <a href='mailto:mry.mcginty@gmail.com'>mry.mcginty@gmail.com</a>
          </p>
          <a href='https://linkedin.com/in/mrycollins' target='_blank'>Connect on LinkedIn</a>
        </div>
      </div>
    )
  }
}
export default Contact
